import { AllMovies, MovieApi } from "../types/moviesType";
import axios from "axios";
import {dispatch} from 'react-redux'
export const getAllMoives =  () => {
    return async(dispatch)=>{
        const res = await axios.get(MovieApi);
        dispatch()
    }
  
  return ;
};
